import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class BestGenreRow extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		return (
			<div class="container" className="airbnbResults">
				<div class="row" className="picture_link">
					<div class="col-6">
						<a href = {this.props.airbnbResults.picture_url}>
							<img src={this.props.airbnbResults.picture_url} className="picture" alt="Apartment" />
							</a>
					</div>
				</div>
				<div class="row">
					<div class="col" className="name">{this.props.airbnbResults.name}</div>
				</div>
				<div class="row">
					<div class="col" className="accommodates">{this.props.airbnbResults.accommodates}</div>
				</div>
				<div class="row">
					<div class="col-4" className="beds">{this.props.airbnbResults.beds}</div>
					<div class="col-4" className="price">{this.props.airbnbResults.price}</div>
					<div class="col-4" className="rating">{this.props.airbnbResults.rating}</div>
				</div>

			</div>
		);
	}
}
